import React from "react";
import Sidebar from "./Sidebar";
import Dashboard from "./Dashboard";
import "./dashboard.css";

function App() {
  return (
    <div className="app-container">
      <Sidebar />
      <main className="main-content">
        <Dashboard />
      </main>
    </div>
  );
}
export default App;
